import './App.css';
import boxes from './boxes';
import { useState } from 'react';
function App(props) {
  const [contact,setContact]=useState(boxes)
  const cl=props.darkMode?"black":"pink";
  const styles ={
    backgroundColor :{cl}
  }
  let box=contact.map((a)=>
    a.on?<div style={styles} className='box' key={a.id}></div>:<div className='box2' key={a.id}></div>
  )
  return (
    <div >
      {box }
    </div>

  )
};
export default App;
